import React from "react";
import Dashboard from "../productimages/laptop.png";
import Android from "../productimages/";
import "./product.css";

const Product = () => {
  return (
    <div className="products-container">
      <h2 className="products-heading">Products</h2>

      <div className="product-item">
        <h3 className="product-subtitle">Dashboard</h3>
        <div className="product-content">
          <img src={Dashboard} alt="Dashboard" className="product-image" />
          <p className="product-description">
            We have Sacco tools which will enable your Sacco to <span className="highlight">APPROVE</span>, <span className="highlight">TRACK</span> and View Sacco <span className="highlight">ANALYTICS</span>.
          </p>
        </div>
      </div>

      <div className="product-item">
        <h3 className="product-subtitle">Android App</h3>
        <div className="product-content reverse">
          <p className="product-description">
            We have member tools which will enable your Saccomember to <span className="highlight">SAVE</span>, <span className="highlight">BORROW</span> and <span className="highlight">REPAY</span> through their mobile phones.
          </p>
          <img src={Android} alt="Android App" className="product-image" />
        </div>
      </div>
    </div>
  );
};

export default Product;
